      const canvas = document.getElementById('c');
      const ctx = canvas.getContext('2d');
      const duration = 3000;
      const hold = 1000;
      const total = duration + hold;
      const ease = (t) => 1 - Math.pow(1 - t, 3);
      function draw(t) {
        ctx.clearRect(0, 0, data.w, data.h);
        ctx.fillStyle = '#0b1022';
        ctx.fillRect(0, 0, data.w, data.h);
        const p = t <= duration ? ease(t / duration) : 1;
        data.items.forEach(item => {
          const pts = item.packed.map((pt, i) => {
            const zp = item.zone[i] || item.zone[item.zone.length - 1];
            const x = pt[0] + (zp[0] - pt[0]) * p;
            const y = pt[1] + (zp[1] - pt[1]) * p;
            return [x, y];
          });
          ctx.beginPath();
          pts.forEach((pt, i) => {
            if (i === 0) ctx.moveTo(pt[0], pt[1]);
            else ctx.lineTo(pt[0], pt[1]);
          });
          ctx.closePath();
          ctx.fillStyle = item.color;
          ctx.fill();
        });
      }
      let start = null;
      function tick(ts) {
        if (!start) start = ts;
        let t = ts - start;
        if (t > total) {
          start = ts;
          t = 0;
        }
        draw(t);
        requestAnimationFrame(tick);
      }
      requestAnimationFrame(tick);
    </script>
